import React from "react";
import { HashLink as Link } from "react-router-hash-link";

const navLinks = [
  { to: "#", text: "Home" },
  { to: "#description", text: "About Us" },
  { to: "#multicards", text: "Solutions" },
  { to: "#images", text: "images/logo 1.png", isImage: true }, // Marking this as an image link
  { to: "#blogs", text: "Blogs" },
  { to: "#trails", text: "Trails" },
  { to: "#contact", text: "Contact Us" },
];

const Header = () => {
  return (
    <div>
      <div className="flex gap-16  text-white justify-center items-center p-6 fixed bg-[#392B85] w-full z-20 cursor-pointer">
        {navLinks.map((link, index) => (
          <Link key={index} to={link.to} smooth>
            {link.isImage ? (
              <img src={link.text} alt="logo" className="h-8 w-auto" /> // Render an image link
            ) : (
              <span className="contrast-75">{link.text}</span> // Render a text link
            )}
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Header;
